package ch02.operator04;

public class compOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n1 = 100;
		int n2 = 10;
		int n3 = 100;
		
		System.out.println(n1>n2);
		System.out.println(n1<n2);
		System.out.println(n1 == n3);
		System.out.println(n1>=n3);
	}

}
